import React from 'react';
import PropTypes from 'prop-types';
import { Link } from 'react-router-dom';
import { connect } from 'react-redux';

import { makeStyles } from '@material-ui/core/styles';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';

const useStyles = makeStyles((theme) => ({
  root: {
    '& > *': {
      margin: 'auto',
      width: '100%',
    },
  },
  photo: {
    margin: '0 auto',
    marginBottom: '10px',
    marginTop: '20px',
    width: 128,
    height: 128,
  },
  center: {
    textAlign: 'center',
    margin: 'auto',
    marginBottom: '20px',
  },
  button: {
    marginBottom: "20px"
  },
  hide: {
    display: 'none'
  }
}));

const AtentionClient = (props) => {
  const classes = useStyles();
  const { infos } = props;

  return(
    <div className={classes.root}>
      <Typography>Chamado enviado!</Typography>
      <Typography>Chegaremos assim que possível.</Typography>
      <Typography>Enquanto isso você pode ver nosso cardápio online no botão abaixo:</Typography>
      <Button component={Link} to={`/client/cardapio/?${infos._id}?table=${infos.idTable? infos.idTable: 0}`} 
        variant="contained" color="primary">
        Cardápio online
      </Button>
      <div>
        <Link to={`/client/cardapio/?${infos._id}`}>Ver cadápio online</Link>
      </div>
    </div>
  );
}

AtentionClient.prototypes = {
  infos: PropTypes.array.isRequired
};

const mapStateToProps = state => ({
  infos: state.client.infos
});

export default connect(mapStateToProps)(AtentionClient);
